import React from 'react';
import { ParallaxProvider, ParallaxBanner } from 'react-scroll-parallax';

const Component = () => {
  const parallax = {
    ref: null,
    translateY: [0, 50],
    opacity: [1, 0.3],
    scale: [1.05, 1, 'easeOutCubic'],
    shouldAlwaysCompleteAnimation: true,
  };

  const background = (
    <div className="absolute inset-0 flex items-center justify-center">
      <img
        src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/105988/banner-background.jpg"
        alt="Background"
        className="object-cover w-full h-full"
      />
    </div>
  );

  const headline = (
    <div className="absolute inset-0 flex items-center justify-center">
      <h1 className="text-6xl md:text-8xl text-white font-thin">
        Hello World!
      </h1>
    </div>
  );

  const foreground = (
    <img
      src="https://s3-us-west-2.amazonaws.com/s.cdpn.io/105988/banner-foreground.png"
      alt="Foreground"
      className="object-cover w-full h-full"
    />
  );

  const gradientOverlay = (
    <div className="absolute inset-0 bg-gradient-to-t from-gray-900 to-blue-900" />
  );

  return (
    <ParallaxProvider>
      <ParallaxBanner
        layers={[
          { ...parallax, children: background },
          { ...parallax, children: headline },
          { ...parallax, children: foreground },
          { ...parallax, children: gradientOverlay },
        ]}
        className="aspect-[2/1] bg-gray-900"
      >
        {/* Your content here */}
      </ParallaxBanner>
    </ParallaxProvider>
  );
};
